#include <iostream>
#include <vector>
#include <algorithm>
#include "ListNode.hpp"
using namespace std;
class Solution {
public:
    ListNode *quickSort(ListNode *head, ListNode *tail) {
        if(head==nullptr) return nullptr;
        else if(head->next==nullptr){
            head->next = tail;
            return head;
        }
        
        ListNode *pivotptr = head, *cur;
        int pivot=pivotptr->val;

        ListNode less(0), more(0); 
        ListNode *l=&less, *m=&more;
        for(cur=head->next; cur; cur=cur->next) {
            if(cur->val < pivot) {
                l->next = cur;
                l = l->next;
            }
            else {
                m->next = cur;
                m = m->next;
            }
        }
        l->next = m->next = nullptr;

        l = quickSort(less.next,pivotptr);
        if(l==nullptr) l = pivotptr;
        pivotptr->next = quickSort(more.next, tail);
        return l;
    }
    ListNode *sortList(ListNode *head) {
        return quickSort(head,nullptr);
    }
};
